import courses from '../data/courses.json'

function TheCourse({depts, numbers, title, description}: any ){

  return <div>
    <div className = 'courseHead'>
    <div className = 'courseID'>
      {depts} {' '} {numbers}
    </div>
    <div className = 'title'> {title} </div>
    </div>
      
      <div> {description} </div>

      <button>Add to cart</button>






  </div>;
}

const Courses = () => (
  <>
    {courses.map(({ dept, number, title, prereqs, description }) => (

      <TheCourse depts={dept} numbers={number} title = {title} description = {description}/>
      
    ))}
  </>
)

export default Courses;
